if (msg.component.handledChildren) {
    // here we get the result of the nested handle call.
    if (msg.component.handledChildren.length == Object.keys(msg.component.prop.children).length) {
        delete msg.component.handledChildren;
        return msg;
    } else {
        // next child
        for (let c in msg.component.prop.children) {
            let child = msg.component.prop.children[c];
            if (msg.component.handledChildren.includes(child)) {
                continue;
            }
            msg.component.child = child;
            node.send([null, msg]);
            break;
        }
    }
} else {
    // here the initial call from the start node
    let foundChild = false;
    for (let c in msg.component.prop.children) {
        let child = msg.component.prop.children[c];
        msg.component.child = child;
        msg.component.handledChildren = [];
        node.send([null, msg]);
        foundChild = true;
        break;
    }
    if (!foundChild) {
        return msg;
    }
}
